import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      Main: "Main",
      Servise: "Servise",
      ForAs: "For as",
      Contact: "Contact",
    };
  }
  render() {
    return (
      <div>
        <header>
          <div>Main</div>
          <div>Servis</div>
          <div>For as</div>
          <div>Contact</div>
        </header>
      </div>
    );
  }
}
export default App;
